INSERT INTO `Products` (`Id`, `Ean`, `Name`, `Description`, `Slug`, `BrandId`, `CategoryId`, `SubCategoryId`, `ListPrice`, `SellingPrice`, `Stock`, `ImageUrls`, `Specifications`) VALUES (75, '7506295353492', 'Analgésico Antipirético Vick VitaPyrena Con Extractos De Limón Y Miel Sobres 5g - 5 Unidades', 'Vick VitaPyrena, con extractos de limón y miel, es un analgésico y antipirético que contiene paracetamol 500mg (acetaminofén) y alivia algunos síntomas de la gripe como: la fiebre y los dolores leves a moderados. Disuelva el contenido del sobre de Vick VitaPyrena en agua caliente o té. Encuentre Vick VitaPyrena en su sabor con extractos de limón y miel. Cada caja de Vick VitaPyrena contiene 5 sobres de 5g cada uno. Vick VitaPyrena ayuda a disminuir la fiebre y aliviar dolores leves a moderados de la gripe. Disponible en: GT, SV, HN, PA', 'vitapyrena-box-5gr-analgesico-antipireti', 41, 2, 1, '16.250000000000000000000000000000', '16.250000000000000000000000000000', 10000, '["https://walmartgt.vtexassets.com/arquivos/ids/365900/Analg-sico-Antipir-tico-Vick-VitaPyrena-Con-Extractos-De-Lim-n-Y-Miel-Sobres-5g-5-Unidades-1-38106.jpg","https://walmartgt.vtexassets.com/arquivos/ids/225699/Vitapyrena-Box-5Gr-Analgesico-Antipireti-5-38106.jpg","https://walmartgt.vtexassets.com/arquivos/ids/225700/Vitapyrena-Box-5Gr-Analgesico-Antipireti-6-38106.jpg","https://walmartgt.vtexassets.com/arquivos/ids/342165/Analg-sico-Antipir-tico-Vick-VitaPyrena-Con-Extractos-De-Lim-n-y-Miel-Sobres-5-g-5-Unidades-Analg-sico-Antipir-tico-Vick-Vitapyrena-Con-Extractos-De-Lim-n-Y-Miel-Sobres-5G-5-Unidades-3-38106.jpg","https://walmartgt.vtexassets.com/arquivos/ids/342166/Analg-sico-Antipir-tico-Vick-VitaPyrena-Con-Extractos-De-Lim-n-y-Miel-Sobres-5-g-5-Unidades-Analg-sico-Antipir-tico-Vick-Vitapyrena-Con-Extractos-De-Lim-n-Y-Miel-Sobres-5G-5-Unidades-4-38106.jpg","https://walmartgt.vtexassets.com/arquivos/ids/364954/Analg-sico-Antipir-tico-Vick-VitaPyrena-Con-Extractos-De-Lim-n-Y-Miel-Sobres-5g-5-Unid