INSERT INTO `Products` (`Id`, `Ean`, `Name`, `Description`, `Slug`, `BrandId`, `CategoryId`, `SubCategoryId`, `ListPrice`, `SellingPrice`, `Stock`, `ImageUrls`, `Specifications`) VALUES (332, '0020800790222', 'Fibra Natural Metamucil Multibeneficios 30 dosis - 210g', 'Metamucil, le proporciona más beneficios que cualquier otra fibra. Metamucil está hecho a base de Plantago Psyllium, una fibra 100% de origen natural. Metamucil le da muchos beneficios, y es por eso que la llamamos una fibra ¡multi-beneficios! Su sistema digestivo sale ganando con Plantago Psyllium. Una dieta equilibrada, con el uso de Metamucil, ayuda a reducir la sensación de hinchazón. Esto ocurre porque Metamucil viene con la cantidad apropiada de Plantago psyllium para regular el funcionamiento de su intestino, proporcionando más comodidad para su digestión. Favorece tu proceso natural de limpieza natural que funciona de modo distinto a otras fuentes de fibras: al ingresar en tu estómago, Plantago psyllium forma un gel que atrapa y remueve alimentos no procesados que se quedaron en su sistema digestivo. Fibra Multibeneficios. Restaura la regularidad intestinal. Ayuda a mejorar la salud digestiva. Fibra 100% de origen natural.', 'fibra-metamucil-sabor-natural-210gr', 32, 2, 1, '104.300000000000000000000000000000', '104.300000000000000000000000000000', 10000, '["https://walmartgt.vtexassets.com/arquivos/ids/618495/4296_01.jpg","https://walmartgt.vtexassets.com/arquivos/ids/618496/4296_02.jpg","https://walmartgt.vtexassets.com/arquivos/ids/618497/4296_03.jpg","https://walmartgt.vtexassets.com/arquivos/ids/618498/4296_04.jpg","https://walmartgt.vtexassets.com/arquivos/ids/618499/4296_05.jpg","https://walmartgt.vtexassets.com/arquivos/ids/618500/4296_06.jpg","https://walmartgt.vtexassets.com/arquivos/ids/618501/4296_07.jpg","https://walmartgt.vtexassets.com/arquivos/ids/618502/4296_08.jpg"]', '[{"Name":"Edad Recomendada para uso del Producto","Value":"Adulto"},{"Name":"Es producto sensible a la temperatura?","Value":"No"},{"Name":"Fabricante","Value":"Procter \\u0026 Gamble"},{"Name":"Forma","Value":"Polvo"},{"Name":"Listado de ingredientes","Value":"Cada 7g Contiene: C\\u00E1scara De Semilla De Plantago Psyllium 3.44g, Excipientes: Cps 7g"},{"Name":"Marca","Value":"Metamucil"},{"Name":"Medida de altura","Value":"108mm"},{"Name":"Medida de ancho","Value":"67mm"},{"Name":"Medida de peso","Value":"0,21kg"},{"Name":"Tama\\u00F1o (Gramaje, Volumen)","Value":"0.25kg"},{"Name":"Medida de profundidad","Value":"67mm"},{"Name":"Producto especializado para adultos","Value":"Si"}]');
